tables.table_schema:
CREATE TABLE DanceCompetitionScores (
    participant_id INT PRIMARY KEY,
    participant_name VARCHAR(50) NOT NULL,
    score DECIMAL(5,2),
    ranking INT
);

CREATE TABLE competition_scores (
    participant_id INT,
    score FLOAT,
    round INT
);

CREATE TABLE rankings (
    participant_id INT,
    total_score FLOAT,
    ranking INT
);

CREATE TABLE DanceEvents (
    event_id INT PRIMARY KEY,
    event_name VARCHAR(50),
    event_location VARCHAR(50),
    event_date DATE
);

CREATE TABLE DanceRanks (
    rank_id INT PRIMARY KEY,
    competitor_id INT,
    event_id INT,
    rank INT
);

CREATE TABLE dance_competition_scores (
    competitor_id INT PRIMARY KEY,
    dance_style VARCHAR(255),
    score DECIMAL,
    judge_id INT
);

CREATE TABLE competitors (
    competitor_id INT PRIMARY KEY,
    competitor_name VARCHAR(255),
    country VARCHAR(255)
);

CREATE TABLE judges (
    judge_id INT PRIMARY KEY,
    judge_name VARCHAR(255),
    expertise VARCHAR(255)
);

CREATE TABLE rounds (
    round_id INT PRIMARY KEY,
    round_name VARCHAR(255),
    start_time TIMESTAMP
);

CREATE TABLE rankings (
    competitor_id INT,
    round_id INT,
    rank INT,
    PRIMARY KEY (competitor_id, round_id)
);
